import React from 'react';
class Skills extends React.Component{
	render(){
		return(
			<div id="hero" className="section section-hero">
				<div className="section-hero--copy" data-aos="fade-down">
				<h1>Skills</h1></div>
				<div className="section-hero--image" data-aos="fade-up">
					<ul>
					<li>I am UI Designer/Developer with over 10 years experience in a fast paced digital agency environment. I love to solve problems, and if there's something I can't do - I'm going to figure out how to do it. 
</li>
					</ul>
				</div>
			</div>
			);
	}
}
export default Skills;
